import { Avatar, Card } from "antd";

const UserProfile = () => {
    return (
        <Card>
            <Card.Meta
            avatar={<Avatar>
                Z10
            </Avatar>}
            title="sungoang"
            />
        </Card>
    )
};

export default UserProfile;
